import React from "react";

type ButtonProps = {
  text: string;
  type: string;
};

export default function Button({ text, type }: ButtonProps) {
  switch (type) {
    case "submit":
      return (
        <button
          style={{
            backgroundColor: "yellow",
            color: "transparent",
            width: "2cm",
            height: "1cm"
          }}
          type="submit"
        >
          {text}
        </button>
      );
    case "button":
      return (
        <button
          style={{
            backgroundColor: "yellow",
            color: "transparent",
            width: "2cm",
            height: "1cm"
          }}
          type="button"
        >
          {text}
        </button>
      );
    case "reset":
      return (
        <button
          style={{
            backgroundColor: "yellow",
            color: "transparent",
            width: "2cm",
            height: "1cm"
          }}
          type="reset"
        >
          {text}
        </button>
      );
    default:
      return (
        <button
          style={{
            backgroundColor: "yellow",
            color: "transparent",
            width: "2cm",
            height: "1cm"
          }}
          type={undefined}
        >
          {text}
        </button>
      );
  }
}
